    const technologies = [
        { name: "JavaScript", icon: "" },
        { name: "HTML", icon: "html-icon.svg" },
        { name: "CSS", icon: "css-icon.svg" },
        { name: "React", icon: "react-icon.svg" },
        { name: "Node.js", icon: "nodejs-icon.svg" }
      ];



return(
    <div className='py-20 flex justify-center'>
        <h1 className="text-5xl font-bold text-center p-2 rounded-lg bg-primary">Technologies</h1>

        <div className="columns-2 flex-col lg:flex-row-reverse ">

        <div class="justify-center pl-36 pr-12 pb-10 pt-5">
    <div class="text-left">
      <p class="mb-8">
