        </p>
        <p class="mb-8">
      With my creative ideas and eye for design, I enjoy creating applications that are both visually appealing and user-friendly.
    </p>
    <p class="mb-8">
    Currently, the technologies I'm working with are Javascript, React, and Node.js!</p>
      <div class="flex justify-center">
      <button class="btn btn-primary justify-self-center">Resume</button>
      </div>
    </div>
  </div>


  </div>  




    </div>
);

}
